  KEY `log_invoker` (`log_invoker`),
  KEY `log_type` (`log_type`),
  KEY `log_begin` (`log_begin`),
  KEY `log_function` (`log_function`)
) ENGINE=InnoDB AUTO_INCREMENT=1913 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

