  KEY `title` (`title`),
  KEY `que_type` (`que_type`),
  KEY `publicable` (`publicable`),
  CONSTRAINT `question_ibfk_1` FOREIGN KEY (`que_creator`) REFERENCES `user_sec` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
